import React from 'react';

const Projects: React.FC = () => {
    const projectList = [
        {
            title: 'Trading Analysis Website',style: { backgroundColor: '#448ae76a', padding: '10px', borderRadius: '5px' },
            description: ' A full-stack mobile/web trading prediction app that uses chart pattern recognition, scalping strategies, and machine learning-based price forecasting to assist traders in making smarter decisions.',
            githubLink: <a href="https://github.com/sheiksaqibahmed/Trading-Analyzer-Website.git" target="_blank" rel="noopener noreferrer">GitHub Repository</a>,
            technologies: ['React', 'Node.js', 'MongoDB']
        },
        {
            title: 'Cyber Attack Detection for Wireless Sensors in Microgrids (IoT)', style: { backgroundColor: '#448ae76a', padding: '10px', borderRadius: '5px' },
            description: ' Model for identifying and responding to malicious activities targeting wireless sensor networks that monitor and control microgrid operations and data tampering to ensure the security, reliability, and efficiency.',
            role: 'Academic Project',
            technologies: ['anaconda platform', 'Spyder', 'TensorFlow', 'Python', 'Keras', 'Matplotlib', 'NumPy', 'Pandas', 'Scikit-learn']
        },
        {
            title: 'Small Language Model (NLP)', style: { backgroundColor: '#448ae76a', padding: '10px', borderRadius: '5px' },
            description: 'Fully Python program, This model leverages state-of-the-art natural language processing (NLP) techniques to comprehend, retrieve, and generate responses from various file formats such as txt, pdf, and .docx.',
            githubLink: <a href="https://github.com/sheiksaqibahmed/SLM_PROJECT.git" target="_blank" rel="noopener noreferrer">GitHub Repository</a>,
            technologies: ['python', 'nlp', 'Transformers']
        },
        {
            title: 'Automatic Street Light Sensor System', style: { backgroundColor: '#448ae76a', padding: '10px', borderRadius: '5px' },
            description: ' This project involves the development of an automatic street light control system using light-dependent resistors (LDR) and microcontrollers. The system detects ambient light levels and automatically turns street lights on at dusk and off at dawn, enhancing energy efficiency and reducing manual intervention. Ideal for smart city applications, the system promotes sustainability and cost savings through intelligent lighting automation. ',
            role: 'Academic Project',
            technologies: ['Arduino', 'LDR', 'Microcontrollers', 'sensors']
        }
    ];

    return (
        <section id="projects">
            <h2>Projects</h2>
            <div className="project-list">
                {projectList.map((project, index) => (
                    <div key={index} className="project-item">
                        <h3>{project.title}</h3>
                        <p>{project.description}</p>
                        <p><strong>Role:</strong> {project.role}</p>
                        <p><strong>Technologies:</strong> {project.technologies.join(', ')}</p>
                    </div>
                ))}
            </div>
        </section>
    );
};

export default Projects;
